import React from 'react';
import { Routes, Route, HashRouter } from 'react-router-dom';
import Home from './Home';
import EasyStart from './EasyStart';
import StartMedium from './startMedium';
import StartHard from './StartHard';

export default function Navigation() {
return (
    <HashRouter basename="/">
        <Routes>
            <Route path="/" element={<Home />} />
            <Route path='/easy' element={<EasyStart />} />
            <Route path='/medium' element={<StartMedium />} />
            <Route path='/hard' element={<StartHard />} />
        </Routes>
    </HashRouter>
)

}
